def _try_convert_to_date(self, data):
        if not len(data):
            return data, False

        new_data = data
        if new_data.dtype == "object":
            if np.issubdtype(data, np.bool_):
                new_data = data.astype("bool")
            elif np.issubdtype(data, np.integer):
                new_data = data.astype("int64")
            elif np.issubdtype(data, np.float):
                new_data = data.astype("float64")

        if np.issubdtype(new_data, np.number):
            in_range = (isna(new_data._values) | (new_data > self.min_stamp) | (new_data._values == iNaT))
            if not in_range.all():
                return data, False

        if np.issubdtype(new_data, np.bool_):
            return new_data, True

        date_units = (self.date_unit,) if self.date_unit else self._STAMP_UNITS
        for date_unit in date_units:
            try:
                new_data = to_datetime(new_data, errors="raise", unit=date_unit)
            except (ValueError, OverflowError):
                continue
            return new_data, True
        return data, False
